import { useEffect, useRef, useState } from "react";
import { Box } from "@mui/system";
import React from "react";
import { useNavigate, useSearchParams } from "react-router-dom";
import Icons from "../../Components/Icons/icons";
import { Background, ButtonWithGlyphIcon, FullScreenLoader, NavBar, PrimaryButton } from "../../Components/index";
import InputField from "../../Components/InputField/InputField";
import "./LandingPage.scss"
import TagsFilter from "../../Components/TagsFilter/TagsFilter";
import { sendData } from "../../utils/api";
import { TryCatch } from "@sentry/react";
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormHelperText from '@mui/material/FormHelperText';
import FormControl from '@mui/material/FormControl';
import Select, { SelectChangeEvent } from '@mui/material/Select';
function LandingPage() {
  const navigate = useNavigate();
  const [isLoading, setIsLoading] = useState(false);
  const [urlSearchInput, setUrlSearchInput] = useState("");
  const [selectedTags, setSelectedTags] = useState([]);
  const [recommendationNumber, setRecommendationNumber] = useState(5);



  const handleShowResults = async () => {
    try {
      const response = await sendData(urlSearchInput, selectedTags)
      console.log(response)

    } catch (error) {

    }
  }

  if (isLoading) {
    return <FullScreenLoader showLoader={isLoading} />;
  }
  console.log(urlSearchInput, selectedTags)

  return (
    <>
      <Background>
        <Box className="landing-page-body">
          <InputField
            inputLabel="Enter Image Url"
            placeholder="start typing"
            value={urlSearchInput}
            onChange={(e) => {
              setUrlSearchInput(e.target.value);
            }}
            autoFocus
          />
          <Box sx={{ marginTop: "30px" }}>
            {/* <label htmlFor="input-field" className="input-label" >
              Enter Description
            </label> */}
            {/* <TagsFilter type="multi_select_text" selectedTags={selectedTags} setSelectedTags={setSelectedTags} /> */}
            <InputField
              inputLabel="Enter Description"
              placeholder="start typing"
              value={urlSearchInput}
              onChange={(e) => {
                setUrlSearchInput(e.target.value);
              }}
              autoFocus
            />
          </Box>

          <Box>
            <FormControl sx={{ m: 1, minWidth: 120 }}>
              <InputLabel id="demo-simple-select-helper-label">Age</InputLabel>
              <Select
                labelId="demo-simple-select-helper-label"
                id="demo-simple-select-helper"
                value={recommendationNumber}
                label="Age"
                onChange={()=>setRecommendationNumber(event.target.value)}
              >
                <MenuItem value="">
                  <em>None</em>
                </MenuItem>
                <MenuItem value={10}>Ten</MenuItem>
                <MenuItem value={20}>Twenty</MenuItem>
                <MenuItem value={30}>Thirty</MenuItem>
              </Select>
              <FormHelperText>With label + helper text</FormHelperText>
            </FormControl>
          </Box>
          <Box className="showResultButton">
            <PrimaryButton label="Show Results" onClick={handleShowResults} />
          </Box>
        </Box>
      </Background>
    </>
  );
}

export default LandingPage;
